import React, { Component } from "react";
import "../assets/main.css";

class Header extends Component {
  state = {};
  render() {
    return (
      <header className="main-header fix-position">
        <div className="row text-right">
          <span className="span-class1">
            <a href="register_login.html">ورود</a>
          </span>
          <span>
            <a href="register_login.html">عضویت</a>
          </span>
          <span>
            <a className="span-class2" href="register_login.html">
              راهنما
            </a>
          </span>
        </div>
        <hr size="4px" className="line" />
      </header>
    );
  }
}

export default Header;
